import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container">
      <div className="row">
        <h1 style={{marginLeft:"5px"}}> ROl Calculator</h1>
        <ToggleButton
  value={ self.state.value || false }
  onToggle={(value) => {
    self.setState({
      value: !value,
    })
  }} />
        </div>
      </div>
  );
}

export default App;
